import React from 'react'

function CommentsList(props) {
    console.log(props);
    return (
        <div>
            <ul id="commentlist" className= "commentlist"> 
                 {props.comments.map(function (comment) {
                    console.log(comment);
                    return (
                        <div>
                            <li>
                            {comment.name} {comment.comment}
                            </li>
                            <li>
                            {comment.comment}
                            </li>
                        </div>
                    );
                    })}                         
            </ul> 
        </div>
    )
}

export default CommentsList
